(53, 2, 'Корвет', 'Korvet', '«Корвет» — советский 8-разрядный персональный компьютер.\r\n\r\nРазработан в 1985 году сотрудниками Института ядерной физики Московского государственного университета: Николаем Роем, Александром Скурихиным и Олегом Щербаковым.\r\n\r\n<https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D1%80%D0%B2%D0%B5%D1%82_(%D0%BA%D0%BE%D0%BC%D0%BF%D1%8C%D1%8E%D1%82%D0%B5%D1%80)>', '2018-09-07 12:53:13', NULL, NULL, NULL),
