(288, 18, 'VCS CX2600 (Light Sixer)', NULL, '<http://www.museo8bits.com/2600.htm>\r\n\r\n<http://www.old-computers.com/museum/computer.asp?st=2&c=878>\r\n\r\nSecond edition of Atari 2600. These models were introduced in 1978 and stayed in production for about two years. The thick molding on the sides and curved molding on the front gave way to thinner and more sharply angled molding reducing the weight of the system. The front right and left molding are angular and overlap the woodgrain. The thick RF shielding remained until the four switch models came out. Atari also produced a version of the "Light Sixer" for Sears, which had some minor aesthetic differences to the Atari-branded console.', '2018-09-13 11:39:07', NULL, 75, 1978),
