(1049, 3, 'CLCD', NULL, 'The Commodore LCD (sometimes known in short as the CLCD) was a LCD-equipped laptop made by Commodore International. It was presented at the January 1985 Consumer Electronics Show, but never released. The CLCD was not directly compatible with other Commodore home computers, but its built-in Commodore BASIC 3.6 interpreter could run programs written in the Commodore 128\'s BASIC 7.0, as long as these programs did not include system-specific POKE commands. Like the Commodore 264 and Radio Shack TRS-80 Model 100 series computers, the CLCD had several ROM-based office application programs.\r\n\r\nThe CLCD featured a 2 MHz Rockwell 65C102 CPU (a CMOS 6502 variant) and 32 KB of RAM. The BASIC interpreter and application programs were built into 96 KB of ROM.\r\n\r\n\r\n\r\n<http://www.museo8bits.com/c_lcd.htm>\r\n\r\n<http://www.old-computers.com/museum/computer.asp?st=1&c=108>\r\n', '2018-09-13 11:39:17', NULL, 339, 1985),
