(1663, 3, 'NE Z80', NULL, '', '2018-09-17 17:29:25', NULL, 483, 1981),
(1664, 3, 'Нафаня', 'Nafanya', 'Нафаня — российский клон ZX Spectrum 48K. Выпускался НПО "Аксон" (Москва). Построен на основе специального БМК, на принципиальной схеме имеющего обозначение СК1, а на самой микросхеме — логотип "Аксон" и обозначение СКС. Схема содержит 17 микросхем.\r\n\r\nВ ноябре 1992 года НПО "Аксон" являлось спонсором "Приза номера" журнала "Юный техник", в качестве приза выступал компьютер "Нафаня". На фотографии в журнале он изображён вместе с фигуркой одноимённого персонажа мультфильма "Приключения домовёнка Кузи", монитором МС6105, блоком питания БСП-5. В тот же период компьютер являлся призом в телепередаче "Звёздный час". Инструкция известного экземпляра 06452 датирована 1993 годом.\r\n\r\nЕсть упоминания о версиях со стандартной прошивкой Sinclair BASIC и с модифицированной, отображающий при включении компьютера графический логотип.\r\n\r\nСуществует одноимённой компьютер, вариант Радио-86РК, выпускавшийся объёдинением ЛОМО. Он имеет другой корпус с плёночной клавиатурой.\r\n\r\nПрототип "Нафани" выпускался в металлическом корпусе и имел процессор Z80 в планарном 48-пиновом корпусе.\r\n\r\nОсобенность "Нафани" - дипломат в комплекте, фактически - бесплатный, если учитывать, что другие клоны стоили дороже, а дипломатами не комплектовались. Также к компьютеру прилагались модулятор и джойстик, тогда как для чуть более дорогого "Мастера" и то и другое требовалось покупать отдельно.\r\n', '2018-09-21 17:13:29', NULL, 484, 1992),
(1665, 3, 'МК-88', 'MK-88', 'МК-88 — советский бытовой персональный компьютер, совместимый с IBM PC/XT, а также ЕС ПЭВМ. Разработан в конце 1980-х коллективами Института кибернетики им. В. М. Глушкова АН УССР и Минского ПО ВТ. На первом Всесоюзном конкурсе на создание перспективных моделей бытовых персональных ЭВМ, организованном ГКВТИ СССР и проводившемся в 1989 году, занял первое место и был рекомендован к серийному производству. Производство было начато в начале 1990-х Минским ПО ВТ. В 1991 году цена компьютера составляла около 4000 рублей.\r\n\r\nКомпьютеры МК-88 выпускались в нескольких исполнениях, отличающихся объёмом ОЗУ (128, 256 и 640 Кбайт), наличием в комплекте дисковода, адаптера локальной сети и монитора. Компьютер имел моноблочную конструкцию (клавиатура и системная плата в одном корпусе), с внешними блоком питания и дисководом. В качестве устройства хранения данных мог быть использован бытовой магнитофон. Были предусмотрены подключение принтера, джойстика и дополнительных внешних устройств через разъём системной шины. Для расширения памяти первых выпусков МК-88 позже был разработан модуль ОЗУ объёмом 512 Кбайт.', '2018-09-21 17:25:59', NULL, 485, 1990),
