(1684, 3, 'PS/2 Model 30 286', NULL, 'The Model 30 had either an 8086 or 286 CPU and sported the full 101-key keyboard and standalone monitor along with three 8-bit ISA expansion slots. 8086 models had 720 KB floppies while 286 models had 1440 KB ones. Both the Model 25 and 30 could have an optional 20 MB ST-506 hard disk. 286-based Model 30s are otherwise a full AT-class machine and support up to 4 MB of RAM.\r\n\r\nThe PS/2 Model 30 was the one model of PS/2 that did not have Micro Channel Architecture.it had a PC AT bus.  Second it did not have VGA graphics it had MCGA (Multicolour Graphics Array).\r\n', '2018-10-10 14:15:14', NULL, 48, 1987),
(1685, 2, 'ЕС ПЭВМ', 'ES PEVM', '', '2018-10-15 17:51:56', NULL, NULL, NULL),
(1686, 3, 'ЕС-1841', 'ES-1841', 'Дальнейшее развитие ЕС-1840, аппаратно совместимая с ней 16-разрядная ПЭВМ на процессоре К1810ВМ86 с частотой 4,77 МГц, возможность установки сопроцессора, ОЗУ до 1,5 МБ; два НГМД на 720 КБ; Видеоадаптер CGA с поддержкой растровой графики 160×100, 320×200, 640×200 точек. Дополнительно могли входить в комплект:\r\n\r\n* НМД типа «винчестер» на 5, 10 или 21 МБ Seagate.\r\n* Манипулятор «Колобок» («мышь»).\r\n* Цифровой синтезатор речевых сообщений\r\n* Адаптер локальной сети «Эстафета»\r\n* Блок для установки дополнительных плат расширения\r\n', '2018-10-15 17:52:51', NULL, NULL, 1987),
