(1711, 3, 'Scorpion ZS 256', NULL, 'Scorpion — семейство 8-разрядных домашних компьютеров, клонов компьютера ZX Spectrum, обладающих целым рядом расширений. Компьютеры Scorpion разрабатывались и выпускались санкт-петербургской фирмой Scorpion. Лицом фирмы на ZX Spectrum-сцене был Сергей Зонов, автор одного из ранних клонов ZX Spectrum — схемы «Ленинград».\r\n\r\nКомпьютеры фирмы производились в виде печатных плат, которые могли устанавливаться пользователями в любые подходящие корпуса — в частности, в корпуса MiniTower от IBM PC-совместимых компьютеров, в подобном же виде компьютеры выпускались и самой фирмой.\r\n\r\n', '2018-10-25 17:32:39', NULL, 486, 1991),
