(1713, 18, 'A-320', NULL, 'The Dingoo (full name Dingoo A-320) is a handheld gaming console that supports music and video playback and open game development. The system features an on-board radio and recording program. It is available to consumers in three colors: white, black, and pink. It was released in February 2009 and has since sold over 1 million units.', '2018-10-26 11:24:47', NULL, 487, 2009),
