(1722, 3, 'ЕС-1834', 'ES-1834', 'Der Personal Computer EC 1834 wurde ab 1986 in der DDR vom VEB Robotron-Elektronik Dresden, Fachgebiet Geräte E2 Karl-Marx-Stadt als Hauptentwickler gemeinsam mit dem VEB Buchungsmaschinenwerk Karl-Marx-Stadt (jetzt Chemnitz) und dem VEB Robotron-Büromaschinenwerk „Ernst Thälmann“ Sömmerda entwickelt und in beiden Werken hergestellt. Es wurden etwa 34.000 EC 1834 sowie etwa 120 Funktionsmuster des Modells EC 1834.01/EC 1834.M gebaut.\r\n\r\nDer EC 1834 stellte einen IBM PC XT-kompatiblen PC dar und wurde mit einer mit 4,9152 MHz getakteten Intel-8086-kompatiblen CPU K1810WM86 ausgestattet. Ein Sockel für einen mathematischen Koprozessor (K1810WM87 oder Intel 8087 waren einsetzbar) war vorhanden. Er verfügte über zwei 5,25 Zoll Diskettenlaufwerke (doppelseitig, je 720 kByte Kapazität), eine Festplatte (meist zu 20 MByte, z. T. aber auch 40 MByte, davon waren aber anfänglich nur 32 MByte nutzbar), und hatte einen Hauptspeicher von 256 kByte. Der Arbeitsspeicher konnte mit einer zusätzlichen Speichererweiterung (Kapazität: 384 kByte) auf 640 kByte – damals Grenze des Konventionellen Speichers – erweitert werden.\r\n\r\nDie erste Bauserie wurde z. T. auch ohne Festplatte, dafür aber mit bis zu vier Diskettenlaufwerken ausgeliefert. Ein Teil der Geräte mit Festplatte hatte aber auch nur ein Diskettenlaufwerk. Es soll auch Geräte mit zwei Festplatten gegeben haben. Neben den K 5504.20 / K 5504.50 von Robotron kamen auch bulgarische Festplatten und „West-Importe“ (u. a. MFM-Festplatten der Firma Seagate) zum Einsatz.\r\n\r\nIn der ursprünglichen Ausführung hatte der EC 1834 acht Steckplätze mit einem dreireihigen EFS-Steckverbinder. Diese waren zwar elektrisch mit dem XT-Bus kompatibel, jedoch mechanisch verschieden. Eine modernere Variante (EC 1834.01, auch EC 1834.M genannt) hatte auch einige 8 Bit-ISA-Steckplätze, in die dann auch westliche ISA-Karten (z. B. VGA-Grafikkarten oder ähnliche) passten.\r\n\r\nDer Grafikcontroller war ein U82720. Optional konnte der EC 1834 mit einem Farbgrafik-Adapter aufgerüstet werden, welcher ebenfalls eine Eigenentwicklung von Robotron war. Dieser war (durch einen Emulationslayer) kompatibel zum Grafikstandard CGA (hardwarenahe Spiele liefen problemlos auf dieser Emulation, im Gegensatz zur IBM-VGA-Karte) und unterstützte folgende Auflösungs-Modi:\r\n\r\n* 320 × 200 mit 4 Farben (CGA kompatibel)\r\n* 640 × 200 monochrom\r\n* 640 × 400 monochrom\r\n* 640 × 480 mit 16 Farben aus einer Palette von 4.096 Farben (3x 4 bit)\r\n', '2018-11-01 06:26:19', NULL, 114, 1986),
