(1729, 3, 'Кворум 128', 'Kvorum 128', 'Клон ZX Spectrum 128K без AY-3-8910. Схема построена на БМК КБ01ВГ1-2. В ПЗУ присутствует встроенный тест, монитор и копировщик. Возможность работы как в TR-DOS, так и в CP/M. На задней стенке корпуса компьютера располагались разъёмы для подключения внешнего блока питания, Kempston и Sinclair джойстиков, принтера, магнитофона, телевизора и монитора, а также разъём системной шины для подключения внешнего контроллера дисковода.\r\n', '2018-11-02 17:29:02', NULL, NULL, NULL),
