(1752, 3, 'Робик', 'Robik', 'Робик — клон ZX Spectrum 48K. Производился НПО "Ротор" (г. Черкассы, ныне автомобильный завод) приблизительно с конца 1980-х - начала 1990-х годов. Русифицирован, язык переключается клавишами CAPS L Shift и CAPS C Shift. Имеет дополнительное поле клавиш со стрелками и клавишу стрельбы, подключённые как стандартный Kempston joystick (порт #1F). Схема с раздельными полями памяти. 53 корпуса, ПЗУ в двух 2764, две РТ2.\r\n\r\nПри включении компьютера устанавливался синий цвет фона с белыми буквами и выводилась строка (C) SELTO-ROTOR Computer V02 (или V03).\r\n\r\nСовместимость с фирменной машиной около 40% — в частности, из-за изменений в ПЗУ (последствия русификации). Некоторые пользователи называли этот компьютер "гробик".\r\n\r\nКлавиатура 60-клавишная, герконовая. Выпускалось два варианта клавиатур, отличавшихся нанесёнными на клавиши надписями.\r\n\r\n', '2018-11-03 15:20:03', NULL, 489, 1989),
(1753, 3, 'Символ 128K', 'Simvol 128K', '«Символ» («Игровой компьютер Символ») — российский клон ZX Spectrum 128K. Выпускался ТОО «Форт», Пенза. Имеет встроенный контроллер дисковода, контроллер параллельного порта и музыкальный сопроцессор AY-3-8910. Построен на основе БМК Т34ВГ1, в схеме используется 49 микросхем.\r\n\r\n', '2018-11-05 17:19:39', NULL, NULL, NULL),
(1754, 3, 'Символ', 'Simvol', 'Компьютер имел 4 пятиконтактных выхода: Kempston-джойстик, магнитофон, телевизор цветной (полный RGB+Sync сигнал), телевизор ч/б и один разъём для блока питания 5 В. Отличался дешевизной, предельно упрощённой схемой и маленькими габаритами. Для соединения с цветным телевизором в комплекте поставки имелась плата-адаптер, которую необходимо было вставить в телевизор. Она переводила телевизор в RGB-видео режим, которого у советских моделей не было. В компьютере использовался аналог процессора Z80 — КР1858ВМ1 (или Т34ВМ1), 16 КБ ПЗУ, 48 КБ ОЗУ и БМК Т34ВГ1.\r\n\r\nВ данном компьютере использовалась прошивка клона Didaktik Gama (производство Словакии, Didaktik Skalica Co., 1987—1992 годы), при старте появлялась надпись ©1989 DIDAKTIK SKALICA. Также стоит отметить немного изменённый по сравнению с оригинальным шрифт (полужирный).\r\n', '2018-11-05 17:34:57', NULL, NULL, NULL),
