(1764, 3, 'Спектр 001', 'Spektr 001', '«Спектр-001» — советский 8-разрядный бытовой компьютер, клон ПК Радио 86РК. Выпускался серийно в начале 90-х годов Орловским заводом УВМ имени К. Н. Руднева.', '2018-11-05 18:03:39', NULL, NULL, NULL),
(1765, 3, 'Компаньон М', 'Kompan\'on M', 'Построен на Т34ВГ1, 19 микросхем. ПЗУ в виде двух корпусов 2764. На плате присутствует разводка для кодера и (или) модулятора, но детали не установлены.\r\n\r\nПо-видимому, предполагалось выпускать блоки ППЗУ с записанными программами, для подключения к системному разъёму. Для запуска таких программ на заднюю панель была выведена кнопка СТАРТ. Однако, информации о выпуске подобных блоков нет.\r\n\r\nОсновные разъёмы расположены на задней стенке корпуса. Первые три из них имеют тип DIN7, остальные DIN5. Слева направо (задней стенкой к себе): кнопки «Сброс» и «Старт» (запуск программы из ППЗУ), Kempston-джойстик (К.ДЖ) и Sinclair-джойстик (С.ДЖ), RGB, два разъёма для подключения магнитофона (ЗП и ЧТ), блок питания (БП). Также присутствует место для разъёма видеовыхода (ТВ). На правой боковой стенке корпуса находится системный разъём (ВУ).\r\n', '2018-11-05 18:25:08', NULL, NULL, NULL),
