(1771, 3, 'Учебный микропроцессорный комплект', 'Uchebnyj mikroprocessornyj komplekt', 'Разработан    Рижским    производственным  объединением ВЭФ для обучения основам программирования и конструирования микро-ЭВМ.\r\n\r\nУМК необходим преподавателям и учащимся профессионально-технических училищ, техникумов,  вузов,  кружков  технического творчества, станций юных техников  УМК имеет системную программу  «Монитор», которая  обеспечивает:\r\n\r\n* чтение и модификацию содержимого памяти и регистров микропроцессора;\r\n* выполнение программ пользователя; вычисление контрольной суммы массива памяти;\r\n* заполнение массива памяти константой; перемещение заданного массива  памяти в адресном пространстве.\r\n\r\nЗа дополнительную плату УМК комплектуется набором плат, существенно  расширяющих  функциональные возможности:\r\n\r\n* М2 — макетирование схем сопряжения с устройствами, имеющими  параллельный  интерфейс (предусмотрена розетка для БИС ППЗУ  К573РФ2);\r\n* ППИ — освоение  сопряжения с устройствами, имеющими последовательный синхронный или асинхронный интерфейсы;\r\n* Г1ГМ — программирование БИС ППЗУ  типа К573РФ2. Источник питания, обеспечивающий напряжение 4-24 В;\r\n* АЦЛ — имеет два ЛЦП и два ЦЛП с длиной слова 10 бит;\r\n* ПС — изучение основ вычислительной  техники от элементарных логических операціім до модели простейших ЭВМ;\r\n* КОП — сопряжение УМК с КОП и  позволяот создать локальную сеть на базе УМК.\r\n\r\nНабор сменных плат позволит значительно расширить область применения УМК,  создав на его базе программатор, музыкальную приставку, электронный вольтметр и другие устройства.\r\n\r\n', '2018-11-06 13:39:18', NULL, NULL, NULL),
(1772, 3, 'Агат 7', 'Agat 7', '«Ага́т» — первый советский серийный универсальный 8-разрядный персональный компьютер, ориентированный для применения в народном образовании. Разработан в 1981—1983 гг. в Научно-исследовательском институте вычислительных комплексов (НИИВК). Главный конструктор — Анатолий Фёдорович Иоффе.\r\n\r\nПроизводился серийно с 1984 года на предприятиях Министерства радиопромышленности (Минрадиопрома). Первым освоил производство Лианозовский электромеханический завод (ЛЭМЗ, ПО «Утёс»), впоследствии производство развернули Волжский завод электронно-вычислительной техники (ЭВТ), Ковылкинский электромеханический завод (Мордовия) (КЭМЗ) и Загорский электромеханический завод (ЗЭМЗ, ПО «Звезда»), Минское НПО «Агат» (БССР), Костромской Электромеханический завод (КЭМЗ). К 1988 году было произведено около 12000 машин, за 9 месяцев 1989 года — около 7000.\r\n\r\nСерийное производство Агатов осуществлялось вплоть до 1993 года. Последним, по всей видимости, производство прекратил ЗЭМЗ: сборка прекращена в конце 1993 года, упаковка и отпуск готовых ПЭВМ — в 1994-м. По различным сообщениям в некоторых школах использование Агатов в учебном процессе продолжалось по меньшей мере до 2001 года.\r\n\r\n', '2018-11-06 18:28:30', NULL, NULL, NULL),
