(1781, 3, 'Байт', 'Byte', 'ПЭВМ «Байт» — 8-разрядный домашний компьютер, клон компьютера ZX Spectrum.\r\n\r\nВыпускался с 1989—1990 года Брестским электромеханическим заводом (БЭМЗ), входящим в Брестское производственное объединение средств вычислительной техники (БПО СВТ).\r\n\r\nКомпьютер был доработан по сравнению ZX Spectrum, имел альтернативную периферию ZX Spectrum отечественного производства, был популярен и очень хорошо продавался, хотя и имел ряд недоработок.\r\n\r\nОбъём производства нарастал до 1992 года, с 1992—1993 пошёл на спад. Спад производства был вызван объективной экономической ситуацией в результате распада СССР на постсоветском пространстве. Рост же производства до 1992 года происходил «по инерции»: производственные мощности советского периода были все еще достаточно сильны.\r\n\r\nВсего на БПО СВТ было выпущено порядка 65 тыс. штук.\r\n', '2018-11-16 09:42:13', NULL, 490, 1989),
