(1820, 18, 'Dendy', NULL, 'Dendy (Russian: Де́нди) is a Taiwanese hardware clone of the Family Computer (the Japanese version of the Nintendo Entertainment System), produced for the Russian market. It was released in the early 1990s by the Steepler company. Since no officially licensed version of the NES was ever released in the former USSR, the Dendy was easily the most popular video game console of its time in that region and enjoyed a degree of fame roughly equivalent to that experienced by the NES/Famicom in North America and Japan. In 1992, Dendy was selling in Russia for 39,000 rubles[citation needed] (roughly 70–80 USD); by 1994, over one million Dendy units were sold in Russia, and the price was roughly $35.', '2018-11-30 13:19:18', NULL, 491, NULL),
