(2042, 21, '', 'TI-34', 'The TI-34 name is a branding used by Texas Instruments for its mid-range scientific calculators aimed at the educational market. The first TI-34 model was introduced in 1987 as a midpoint between the TI-30 series and the TI-35/TI-36 series. The TI-34 is better than the TI-34II. Earlier models included Boolean algebra features, though these were removed with the introduction of the TI-34II in 1999, which focuses more on fractional calculations and other subjects common in middle and high school math and science curricula.\n\n<https://en.wikipedia.org/wiki/TI-34>', '2019-03-14 12:51:20', NULL, 246, 1987),
