(2063, 22, '', 'Cassette tape', 'Compact Cassettes come in two forms, either already containing content as a prerecorded cassette (Musicassette), or as a fully recordable "blank" cassette. Both forms are reversible by the user.\n\nThe compact cassette technology was originally designed for dictation machines, but improvements in fidelity led the Compact Cassette to supplant the stereo 8-track cartridge and reel-to-reel tape recording in most non-professional applications. Its uses ranged from portable audio to home recording to data storage for early microcomputers.\n\nCompact Cassettes contain two miniature spools, between which the magnetically coated, polyester-type plastic film (magnetic tape) is passed and wound. These spools and their attendant parts are held inside a protective plastic shell which is 4×2.5×0.5 in at its largest dimensions. The tape itself was commonly referred to as "eighth-inch" tape, supposedly 1/8 inches wide, but it was slightly larger: 0.15 in. Two stereo pairs of tracks (four total) or two monaural audio tracks are available on the tape; one stereo pair or one monophonic track is played or recorded when the tape is moving in one direction and the second (pair) when moving in the other direction. This reversal is achieved either by flipping the cassette, or by the reversal of tape movement ("auto-reverse") when the mechanism detects that the tape has come to an end.', '2019-08-04 19:04:47', NULL, NULL, NULL),
